import React from 'react';
import logo from './logo.svg';
import './App.css';
import Header from './components/Header/Header';
import Navbar from './components/Header/Navbar';




const App = () => {
  return (
    <div className='app-wrapper'>

     <Header/>

      <Navbar/>

      <div className='content'>
        <div>
        <img src="https://live.staticflickr.com/7218/7184786016_1ddab461e8_b.jpg"></img>
        </div>
        <div>
          ava + description
        </div>
        <div>
          My posts
          <div>
            New posts
          </div>
          <div>
            <div>
              post 1
            </div>
            <div>
              post 2
            </div>
          </div>
        </div>
      </div>

    </div>
  );
}



export default App;
